script: |
  super -f text -I q5699.spq | sort > q5699.out

inputs:
  - name: q5699.spq
    data: |
      SELECT + cor0.col2 * cor0.col0 * - ( - cor0.col0 ) + - cor0.col0 / col1 + - col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q5699.out
    data: |
      1292
      158124
      237137
